webpackJsonp([0xd8dc38ece680],{7630:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/177175128/" title="Photo Sharing"><img src="http://static.flickr.com/44/177175128_ac093a8782.jpg" width="500" height="452" alt="IMG 1524" /></a></p>\n<p>The white one is mine, the black one is MamaMaus\'. Christopher went empty today.</p>\n<p>For all the complaining I did, the MacBook arrived on the exact day Apple estimated delivery. It doesn\'t whine, it doesn\'t moo, and it\'s not too hot.</p>\n<p>MamaMaus\' employer is rolling out Blackberries throughout Europe. She\'s been used to replicating Lotus Notes on her notebook. Her first comment: "This is easy. You mean I don\'t have to sync it?"</p>',fields:{title:"Toys",date:"28 Jun 2006",url:"https://papascott.de/2006-06-28-toys/"}}},pathContext:{slug:"/2006-06-28-toys/",prev:{fields:{title:"Holiday on Ice",date:"26 Jun 2006",slug:"/2006-06-26-holiday-on-ice/"}},next:{fields:{title:"Don't Get Naked",date:"01 Jul 2006",slug:"/2006-07-01-dont-get-naked/"}}}}}});
